import React from "react";
import Nav from "../Nav/Nav"
import { HomeWrapper} from "../Nav/NavStyles";

const Home = () => {
  return (
    <HomeWrapper>
         <Nav />
      <body>
        <p>Home</p>
        <img src="../pinkhairs.jpg" class="food" alt="Pink Hair"/>
      </body>
      </HomeWrapper>
  );
}

export default Home;
